function Placeholder() {
    return (
        <div>
            <h1>placeholder</h1>
            <h2>placeholder</h2>
            <h3>placeholder</h3>
            placeholder
            <div className="color-primary color"></div>
            <div className="color-secondary color"></div>
            <div className="color-accent color"></div>
            <div className="color-background color"></div>
            <div className="color-font-primary color"></div>
            <div className="color-font-secondary color"></div>
        </div>
    );
}

export default Placeholder;
